import React from 'react';

const Login = () => {
    return (
        <div className="container-fluid">
            <div className="row">
                <div className="col-sm-6 col-md-3">
                    <img src="../images/globe.png" alt="logo"/>
                </div>
            </div>
        </div>
    )
}

export default Login;
